import "./topbar.css"
import { useNavigate } from "react-router-dom";
import { useAuth } from "../../contexts/authContext/AuthProvider";
import UserInfo from "../pages/settings/userinfo/UserInfo";

export default function Topbar({ onAddClick }) {
  const navigate = useNavigate();
  const { userLoggedIn } = useAuth();

  return (
    <div className="topBar">
      <header className="headerTitle">Habits</header>
      <div className="buttonContainer">
        <button className="addButton" onClick={onAddClick}>
          <i className="bi bi-plus-lg"></i>
        </button>
        <button 
          className="loginButton2" 
          onClick={() => navigate(userLoggedIn ? <UserInfo />: '/login')}
        >
          <i className="fa-solid fa-circle-user"></i>
        </button>
      </div>
    </div>
  );
}
